import React from "react";
import { Link } from "react-router-dom";

const ReportIssue = () => {
  return (
    <div className="min-h-screen bg-indian-lightGreen py-12">
      <div className="container mx-auto px-4 max-w-2xl">
        <div className="bg-white rounded-xl shadow-md p-8 border-2 border-indian-green">
          <h1 className="text-3xl font-bold text-indian-green mb-6 text-center">Report an Issue</h1>
          <p className="text-gray-600 mb-8 text-center">Coming soon - Report form will be implemented here</p>
          <div className="text-center">
            <Link to="/" className="bg-indian-green hover:bg-green-800 text-white font-semibold py-2 px-6 rounded-lg transition-colors">
              Back to Home
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ReportIssue;
